  <thead>
    <tr>
      <th>Nombre</th>
      <th>Apellido</th>
      <th>Email corporativo</th>
      <th>Password</th>
    </tr>
  </thead>
  <tbody>
    {credentials.map((c, index) => (
      <tr key={index}>
        <td>{c.firstName}</td>
        <td>{c.lastName}</td>
        <td>{c.email}</td>
        <td>{c.password}</td>
      </tr>
    ))}
  </tbody>
</table>
